import React from "react";
import styled from "styled-components";
const Navbar = () => {
    return <Component>Im the navbar</Component>;
};
const Component = styled.div`
    display: none;
    @media (min-width: 768px) {
        display: flex;
        justify-content: space-around:
        grid-area: navbar;
    }
`;
export default Navbar;
